import {Component} from 'react';
import {About,Home} from './pages';
class App extends Component{
 render(){
   return (
     <div>
        <Route path="/about" Component={About}></Route>
        <Route exact path="/" Component={Home}></Route>
     </div>
   );
 }
};

export default App;
